export const COLUMNS = [
    {
        Header: 'S.NO',
        accessor: 's.no'
    },
    {
        Header: 'Compliance Type',
        accessor: 'compliance_type'
    },
    {
        Header: 'Application Name',
        accessor: 'application_name'
    },
    {
        Header: 'Date',
        accessor: 'date'
    },
    {
        Header: 'Status',
        accessor: 'status'
    },
    {
        Header: 'Action',
        accessor: 'action'
    }
]
